import React from "react";
import "./card-list.style.css";
import { Card } from "../card/card.component";

export const cardList = (props) => {
    return(
        <div className="card-list">
            {props.monsters.map(monster => (<h2>{monster.name}</h2>))}
        </div>
    )
}
